package training.strings;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class Anagrams {
    public boolean isAnagram(String s, String t) {
        Set<Character> union = new HashSet<>();
        Map<Character, Long> sDict = new HashMap<>();
        Map<Character, Long> tDict = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            union.add(s.charAt(i));

            sDict.put(s.charAt(i), sDict.getOrDefault(s.charAt(i), 0L) + 1);
        }

        for (int i = 0; i < t.length(); i++) {
            union.add(t.charAt(i));

            tDict.put(t.charAt(i), tDict.getOrDefault(t.charAt(i), 0L) + 1);
        }

        for (char c: union) {
            if (!sDict.containsKey(c) || !tDict.containsKey(c) || !sDict.get(c).equals(tDict.get(c))) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        Anagrams a = new Anagrams();

        System.out.println(a.isAnagram("anagram", "nagaram"));

        String s = "";
        String t = "";

        System.out.println(a.isAnagram(s, t));
    }
}
